import React, { Component } from 'react'

class ColorBox extends Component {
    render(){
        return(
            <div className="ColorBox">
                <div style={{backgroundColor: this.props.colorCode, height: "20vh"}}>{this.props.colorName} {this.props.colorCode}</div>
            </div>
        )
    }
}

export default ColorBox;
